    ]
    return (
        <div className="App">
             <div className="catagories">
                {cat.map((title,imgurl)=>(
                    <div className="catagory-container" style={{backgroundImage:`url($())`}}>
                        <div className="catagory-body"> 
                            <h2>{title.title} </h2>
                            <button className="button">Shop Now</button>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    )
}
